{
  "id": "manzano-u21-quarto-successo-di-fila-e-vetta-agganciata-20251030164301",
  "title": "Manzano U21: quarto successo di fila e vetta agganciata",
  "meta": "Patrick Lavaroni ‚Äî Gioved√¨ 30 Ott 2025",
  "content": "**3-0 senza appello ai Pupi, partita dominata in tutte le fasi. Ora un test importante in casa del Mirano** **Manzano:** Polidori ¬©, Persolia, **Zharri Erjon**,",
  "fullText": "Manzano U21: quarto successo di fila e vetta agganciata patrick lavaroni **3-0 senza appello ai pupi, partita dominata in tutte le fasi. ora un test importante in casa del mirano**\n\n**manzano:** polidori ¬©, persolia, **zharri erjon**, **romanu»õ**, **khayari**, polimeni, dalmasson, **zraidi**, **zharri kleidi**, **zenilli**, **saro**, **bon**. **all:** **piani**\n\n**a.a. pupi:** nota, buliga, russo ¬©, tonon, ingrassia, rossa, carrubba, d‚Äôambra, tumicelli, sorgato, prestera. **all:** **sartori**\n\n**gol:** primo tempo: **polidori**, secondo tempo: **zraidi** e **bon**\n\nil **manzano u21** vince con merito per **3-0** contro l‚Äô**adelino arieti pupi**, mettendo in fila il **4¬∞ successo consecutivo** e guadagnandosi l‚Äôaggancio in vetta alla classifica col **sanve mille**, a quota 12 punti.\nprimo tempo dominato grazie alla maggior qualit√† e fisicit√† nei duelli individuali. il **manzano** passa in vantaggio grazie al colpo di biliardo di **capitan polidori**. nella ripresa la squadra abbassa leggermente i ritmi, ma i centri di **zraidi** e **bon** arrotondano un risultato mai in discussione. prossimo appuntamento in trasferta, sabato prossimo (1 novembre) sul campo dell‚Äôostico **mirano**, 4¬∞ in classifica.\n\n**primo tempo ‚Äì** manzano in controllo da subito. il fulcro √® **kleidi zharri**, che con le sue percussioni centrali mette in crisi la difesa dei **pupi**. pi√π volte sollecitato il portiere **nota**, in avvio il migliore dei suoi. tante le occasioni locali: **polimeni** viene imbeccato da **kleidi zharri** e chiuso a tu per tu, **polidori** ci prova da fuori, solo una deviazione salva i **pupi**. anche **kleidi zharri** cerca la rete dalla distanza: il suo rasoterra fa la barba al palo.\noccasionissima da rimessa laterale, **polidori** √® lesto a battere quando il portiere √® ancora lontano dai pali, **kleidi zharri** riceve ma non inquadra lo specchio. poco dopo ancora **polidori** ispiratissimo: passaggio di rabona a smarcare **erjon zharri** nel mezzo, che calcia fuori di poco.\na 10‚Äô dalla sirena ci prova anche **zenilli**, pallone sulla traversa. √® il preludio del gol: **erjon zharri** batte un laterale per **capitan polidori** che dalla fascia indovina l‚Äôangolino basso sul secondo palo con un potente rasoterra: 1-0 **manzano**.\nil **manzano** non √® sazio e ci prova ancora: occasioni per **zenilli** e **bon**, smarcati rispettivamente da **polidori** ed **erjon zharri**. nel recupero arriva la prima occasione degna di nota per i **pupi**: **russo** si invola verso la porta, bravo il portiere **saro** a chiudergli lo specchio.\n\n**secondo tempo ‚Äì** la ripresa inizia benissimo: **polidori** riceve sulla fascia e lascia partire una botta dalla lunghissima distanza, **zraidi** √® provvidenziale a deviarla in porta per il 2-0.\nla squadra di **piani** abbassa i ritmi e si prende qualche rischio in pi√π, come quando **ingrassia** ruba palla a centrocampo e si invola in solitaria verso la porta di **saro**, il suo tiro termina fuori. ad ogni modo i manzanesi giocano sempre in totale controllo della gara.\ngran lancio di **saro** per **kleidi zharri** che si ritrova a tu per tu con **nota** che lo blocca. **nota** ancor decisivo con una gran parata su **khayari**, ben smarcato da **erjon zharri**. l‚Äôabilit√† del **manzano** nell‚Äôuno contro uno rimane uno dei punti chiave, con il **pupi** che raggiunge rapidamente il 6¬∞ fallo, bravo **erjon zharri** che si procura il tiro libero. dai 10 metri va il **vice capitano romanu»õ**, che calcia largo, si rimane sul 2-0.\nsull‚Äôaltro fronte il **pupi** per poco non riapre la partita, ma finisce per incassare il contropiede che la chiude definitivamente. dal limite l‚Äôospite **d‚Äôambra** tiene bene il pallone, poi si gira e prende il palo pieno. **manzano** lucido nel ripartire subito: **kleidi zharri** conduce centralmente e al momento giusto allarga per **bon** che fa 3-0.\ngli ultimi minuti sono un monologo manzanese: ancora una doppia occasione per **kleidi zharri**, ben parato due volte da **nota**.\n\nottimo risultato per la squadra di **piani**, ora appaiata in testa alla classifica con il **sanve mille** (meglio piazzato solo per un gol in pi√π nella differenza reti). ora un test molto importante contro il **mirano**, squadra che ha saputo strappare un 3-3 sul campo del **cuore celtic verona**, corazzata sempre vincente prima di questa giornata.",
  "filename": "manzano-u21-quarto-successo-di-fila-e-vetta-agganciata-20251030164301.html"
}
