{
  "id": "band-of-brothers-il-manzano-e-in-semifinale-20251102135444",
  "title": "‚ÄúBand of Brothers‚Äù, il Manzano √® in semifinale",
  "meta": "Patrick Lavaroni ‚Äî Domenica 02 Nov 2025",
  "content": "_Superato il Pasiano per 6-1, sul tabellino dei marcatori la fanno da padrone i fratelli De Giorgio e Zharri. Semifinale contro l‚ÄôAquila Reale a dicembre_  *Cal",
  "fullText": "‚Äúband of brothers‚Äù, il manzano √® in semifinale patrick lavaroni _superato il pasiano per 6-1, sul tabellino dei marcatori la fanno da padrone i fratelli de giorgio e zharri. semifinale contro l‚Äôaquila reale a dicembre_ \n\n*calcetto manzano*: polidori, stacco ¬©, zharri erjon, de giorgio leonardo, iurlaro, de giorgio lorenzo, saro, tancos, pozzatello, valentinuzzi, klejdi zharri, pascale. all: movio-sironi\n\n*pasiano c5*: barberi, koni, gobbo, crapa, avdyli, zoccolan luca ¬©, zoccolan marco, oshafi, serraino, giordani, shkalla, abis. all: polo grava\n\n*gol*: 12‚Äô pt kleidi zharri, 16‚Äô pt leonardo de giorgio, 17‚Äô pt lorenzo de giorgio, 19‚Äô pt klejdi zharri, 9‚Äô st avdyli, 17‚Äô st stacco, 20‚Äô st erjon zharri\n\nmissione compiuta per il manzano, semifinali raggiunte grazie al successo per 6-1 contro il pasiano nei quarti. inizio con i pordenonesi che creano diverse occasioni, poi vengono fuori i seggiolai grazie al centro di *klejdi zharri*. la partita si mette in discesa, arrivando alla sirena sul 4-0 per i padroni di casa. ripresa agguerrita, a tratti confusionaria, il pasiano accorcia, prima di capitolare definitivamente per 6-1. nel tabellino dei marcatori la fanno da padroni i fratelli *de giorgio* e i fratelli *zharri*, un centro anche per il capitano *stacco*.\n\n*nuovo sponsor* ‚Äì ai quarti ha ‚Äúesordito‚Äù la nuova muta bianco-blu del calcetto manzano per il 2025/26. la nuova linea di maglie √® sponsorizzata da *ediltech*, realt√† imprenditoriale attiva nelle costruzioni e manutenzioni residenziali e condominiali. la consociata *ediltech sport* si occupa dell‚Äôinstallazione di impianti sportivi, lavorando attualmente per le *olimpiadi invernali di milano cortina 2026*.\n\n*primo tempo* ‚Äì il manzano colleziona le prime chance con *iurlaro* che centra il palo e il portiere *abis* che per poco non pasticcia sul tiro di stacco. per il resto la prima parte della prima frazione vede diverse palle gol per il pasiano. *pozzatello* attento due volte su *giordani*: la prima facendo bene la guardia sul primo palo, la seconda in solitaria, dopo che il 10 ospite aveva sradicato un pallone sanguinoso dal limite dell‚Äôarea. decisivo il portiere ex palmanova.\nancora chance per il pasiano, puntuale *valentinuzzi* che spazza sulla linea di porta.\nil manzano si rif√† vivo in zona gol grazie a tancos che pesca polidori sul secondo palo, bravo abis che lo mura da distanza ravvicinata. √® il preludio del gol: *klejdi zharri* riceve lo scavetto di *tancos* sulla fascia e fulmina abis con un rasoterra decentrato: 1-0.\nil manzano prende le redini della partita: *polidori* semina il panico nell‚Äôarea avversaria smarcando iurlaro solissimo in mezzo, il suo appoggio termina clamorosamente fuori.\naltre occasioni locali con iurlaro e pascale, in un episodio bravo abis in tuffo. tuttavia il raddoppio √® solo una questione di tempo: *pascale* intercetta e allunga per *lorenzo de giorgio*, il pivot srotola il pallone alle spalle per l‚Äôinserimento del fratello leonardo che fa 2-0. tempo pochi minuti e *leonardo de giorgio* torna il favore al fratello, palla lunga in area, con lorenzo che riesce ad anticipare l‚Äôuscita di abis: 3-0.\nprima della sirena arriva anche il poker: ripartenza orchestrata da pascale, *klejdi zharri* riceve sulla fascia, siglando doppietta personale e 4-0.\n\n*secondo tempo* ‚Äì il pasiano non si arrende e prova a riaprire la partita: *serraino* divora con la porta spalancata, poi pozzatello chiude *luca zoccolan* da vicino.\nla partita √® molto fisica, con le squadre che lottano quasi in maniera confusa. il manzano ha diverse occasioni ma non sfrutta, clamorosa quella costruita da *valentinuzzi* ed *erjon zharri*, che soli in coppia davanti al subentrato *barberi* non riescono a segnare. la legge del ‚Äúgol sbagliato, gol subito‚Äù punisce i seggiolai: in ripartenza serraino pesca *avdyli* che fa 4-1.\nil manzano risponde col palo di polidori, ma dietro deve ancora aggrapparsi a *pozzatello*, autore di almeno 4 interventi decisivi in area, il pasiano coglie anche il palo interno con *serraino*. \ni padroni di casa amministrano e hanno buone occasioni con iurlaro e stacco. a 3‚Äô dalla fine la punizione di *stacco* vale il 5-1. ultima rete con *lorenzo de giorgio* che trova il 2¬∞ assist di giornata scaricando per l‚Äôaccorrente *erjon zharri*, autore del 6-1 con un tocco morbido.\n\n*prossime partite* ‚Äì il manzano si qualifica alle semifinali dove affronter√† l*‚Äôaquila reale* (che ha superato l‚Äôudine city). l‚Äôaltra gara vedr√† protagoniste *palmanova* e *martignacco*, che hanno battuto rispettivamente udinese e aquileia. non c‚Äô√® ancora una data ufficiale per le sfide, che verranno programmate per dicembre. nel frattempo inizia il campionato, il manzano riposer√† nel primo turno, esordendo alla seconda giornata, *sabato 15 novembre* sempre contro *l‚Äôaquila reale* a *feletto*.\n\n*under 21* ‚Äì weekend sfortunato per *l‚Äôunder 21* che cade per *2-0* nello scontro d‚Äôalta classifica in casa del *mirano*. i manzanesi rimangono comunque nel gruppo di testa, quarti in classifica a quota 12, a -3 dalla capolista sanve mille. sabato prossimo, *8 novembre alle 19.00*, si torna a giocare *in casa* contro il *leonicena*, squadra ultima in classifica insieme all‚Äôariano, ancora a caccia dei primi punti.",
  "filename": "band-of-brothers-il-manzano-e-in-semifinale-20251102135444.html"
}
