{
  "id": "pozzatello-abbassa-la-saracinesca-colpo-manzano-in-casa-dell-aquila-20251116170001",
  "title": "Pozzatello abbassa la saracinesca, colpo Manzano in casa dell‚ÄôAquila",
  "meta": "Patrick Lavaroni ‚Äî Domenica 16 Nov 2025",
  "content": "_Il Manzano lotta ed √® spietato in attacco, eurogol di Genna, prestazione monumentale di Pozzatello_ **Aquila Reale:** Agrizzi ¬©, Bassetti, Besic, Joao Pedro, D",
  "fullText": "pozzatello abbassa la saracinesca, colpo manzano in casa dell‚Äôaquila patrick lavaroni _il manzano lotta ed √® spietato in attacco, eurogol di genna, prestazione monumentale di pozzatello_\n\n**aquila reale:** agrizzi ¬©, bassetti, besic, joao pedro, dindo, dorbol√≤, florio, manushi, quku, vitor hugo, zanuttini. all: genna \n\n**c5 manzano 1988:** polidori, stacco ¬©, zharri erjon, genna, de giorgio leonardo, iurlaro, de giorgio lorenzo, saro, tancos, pozzatello, valentinuzzi, zharri klejdi. all: movio-sironi\n\n**gol:** 6‚Äô pt leonardo de giorgio, 9‚Äô pt genna, 13‚Äô pt tancos, 19‚Äô pt valentinuzzi, 2‚Äô st vitor hugo, 3‚Äô st aut. agrizzi, 11‚Äô st florio, 12‚Äô st iurlaro, 19‚Äô st vitor hugo, 20‚Äô st joao pedro.\n\nil manzano si mette il coltello tra i denti e strappa i primi 3 punti del suo campionato con una prestazione da libro cuore. **aquila reale** battuta per **6-4**, prima partita stagionale su un campo piccolo, dove i seggiolai si sono fatti valere nei contrasti e hanno saputo massimizzare le occasioni in avanti. in difesa protagonista assoluto il portiere **pozzatello** che abbassa la saracinesca e sforna miracoli in serie davanti ai numerosi tentativi dell‚Äôaquila. tra i giocatori di movimento ottima prestazione di **genna,** granitico in difesa e autore di un eurogol (oltre a propiziare un‚Äôautorete). grande personalit√† da parte dei giovani in campo, soprattutto **iurlaro** e **polidori** che giocano da veterani.\n \n**primo tempo** ‚Äì le dimensioni del campo fanno s√¨ che le conclusioni in porta siano frequenti. l‚Äôaquila reale ha tanti tiratori e i tiri dei vari **besic, zanuttini** e **vitor hugo** scaldano da subito le mani di pozzatello. manzano meno presente in avanti, ma in partita fin da subito. i seggiolai pazientano e la sbloccano al 7‚Äô. **polidori** viene chiuso due volte, la palla schizza all‚Äôindietro sui piedi di **leonardo de giorgio** che la indirizza verso l‚Äôangolino basso: 1-0.\nl‚Äôaquila ha subito una chance per pareggiare: **joao pedro** sfonda sulla fascia e calcia fuori di pochissimo.\nall‚Äô11‚Äô raddoppio del manzano, tancos batte una rimessa corta per **genna** che all‚Äôaltezza del centrocampo lascia partire un bolide sotto l‚Äôincrocio dei pali: eurogol e raddoppio: 2-0.\nmanzano su di giri e aquila che spinge: ancora joao pedro pericolosissimo che percuote centralmente, il suo tiro termina a fil di palo. ospiti molto pi√π concreti: **klejdi zharri** contrasta con joao pedro al limite dell‚Äôarea avversaria, il pallone rimane l√¨, preda di **tancos** che fa 3-0.\nle offensive locali sono frequenti, quasi letale l‚Äôuno-due tra vitor hugo e florio, con il secondo che spara alto a porta semivuota. per il resto **pozzatello** fa gli straordinari: con la mano di richiamo manda sulla traversa un tiro avversario, poi due uscite provvidenziali su vitor hugo, prima del riflesso a prendere il pallone dopo il palo interno di **zanuttini.** importanti anche i recuperi difensivi di polidori e tancos.\nil manzano riesce a calare il poker prima della sirena: laterale di leonardo de giorgio che la mette tesa in area, velo di polidori, con **valentinuzzi** subito appostato in area per appoggiare il 4-0.\n\n**secondo tempo** ‚Äì la ripresa inzia sempre con il forcing dell‚Äôaquila che prende subito un palo esterno. sugli scudi ancora **pozzatello** che piazza un miracolo clamoroso su **dorbol√≤,** il pivot riceve uno scarico dal limite e calcia forte e semiangolato a mezzaltezza. il portiere ci arriva in spaccata con la mano tesa.\nla porta rimane inviolata ancora per poco, al 2‚Äô **vitor hugo** riesce a bucare la mani di pozzatello per l‚Äô1-4. il portiere ex palmanova si riscatta subito con un riflesso clamoroso su una deviazione sottoporta.\nin avanti la dea bendata sorride al manzano: **genna** calcia rasoterra dalla distanza, palla sul palo e poi sulla schiena di **agrizzi,** carambolando in porta per il 5-1.\nil clima √® focoso e i padroni di casa spingono per ribaltare l‚Äôinerzia della partita. pozzatello fa ancora la differenza con interventi determinanti. bisogna attendere la met√† della ripresa perch√© **florio** riesca a bucarlo dal centro: 2-5.\ncome l‚Äôaquila abbozza la rimonta, il manzano si riporta sul +4, bravo **iurlaro** che da fuori raccoglie una respinta e beffa agrizzi con un rasoterra potente: 6-2.\nla partita procede verso la fine e il manzano inizia a vedere il traguardo, abbassando i ritmi. negli ultimi due minuti l‚Äôaquila combatte e segna su corner con **vitor hugo.** poi ancora vitor hugo che serve in mezzo per **joao pedro** che fa 4-6, dimezzando lo svantaggio. mancano pochi secondi e il brasiliano sfiora pure il 5-6 di tacco, venendo fermato solo dalla sirena.\n\nsuccesso importantissimo che d√† morale e sicurezza alla squadra. prossimo turno in casa contro il **pasiano**, i pordenonesi sono reduci dalla vittoria per 8-5 contro l‚Äôudinese futsal. si gioca a manzano, alle ore 16.00, seguir√† lo scontro d‚Äôalta quota tra **l‚Äôunder 21** dei seggiolai e il miti vicinalis. sempre al palazzetto di manzano, alle 19.00.",
  "filename": "pozzatello-abbassa-la-saracinesca-colpo-manzano-in-casa-dell-aquila-20251116170001.html"
}
