{
  "id": "cuore-u21-miti-vicinalis-rimontato-da-2-0-a-2-2-20251124144153",
  "title": "Cuore U21, Miti Vicinalis rimontato da 2-0 a 2-2",
  "meta": "Patrick Lavaroni ‚Äî Luned√¨ 24 Nov 2025",
  "content": "_I giovani seggiolai giocano con furore e acciuffano il pari grazie a Dalmasson e Polimeni_ **C5 Manzano 1988:** Fedrigo, Polidori, Avitabile ¬©, Romanut, Khayar",
  "fullText": "cuore u21, miti vicinalis rimontato da 2-0 a 2-2 patrick lavaroni _i giovani seggiolai giocano con furore e acciuffano il pari grazie a dalmasson e polimeni_\n\n**c5 manzano 1988:** fedrigo, polidori, avitabile ¬©, romanut, khayari, polimeni, dalmasson, zenjili. all piani\n\n**miti vicinalis:** lukaj ¬©, basso, qatani, scotta, bozianu, da riol, pollesel, marson, roci, peruzzetto, masini. all: tarzariol\n\n**gol** - primo tempo: marson, secondo tempo: peruzzetto, dalmasson, polimeni.\n\nprestazione di cuore del manzano u21 che riesce a strappare un pareggio all‚Äôottimo miti vicinalis, dopo essere stato sotto per 2-0. decisivi i centri di **dalmasson** e **polimeni.** i giovani seggiolai si mantengono nel gruppo di testa e raccolgono un punto che fa morale, anche se, a conti fatti, la squadra di **piani** avrebbe avuto le carte in regola per prendersi tutta la posta in palio.\n\n**primo tempo** ‚Äì il miti vicinalis √® la squadra pi√π attrezzata tra quelle passate per ora nel palazzetto di via olivo. tra le sue file si nota **tommaso basso,** classe 2004 cresciuto nelle giovanili del pordenone, che l‚Äôanno scorso ha fatto parte della rosa della prima squadra neroverde in a2 √©lite, trovando anche un gol. \nil manzano ha la panchina corta ma si fa valere: in avvio sono due le occasioni principali con **zenjili** e **polimeni** che mancano la porta di poco da fuori.\nal 10‚Äô il primo momento chiave della partita: il portiere ospite **pollesel** esce forte su zenjili lanciato a rete e viene espulso. il miti tiene lo 0-0 nei due minuti di inferiorit√† numerica e poi colleziona due occasioni con **masini.** nella seconda in particolare, il classe 2007 veneto si divora un gol gi√† fatto sulla linea di porta avversaria.\nil manzano ringrazia ma non riesce a capitalizzare. la squadra di piani gioca con furore agonistico e ha buone individualit√†, ma allo stesso tempo √® confusionaria e pecca di lucidit√†. il miti invece pare pi√π quadrato e costruisce diverse palle gol. determinante il portiere **fedrigo** che chiude bozianu e poi fa un miracolo su **basso,** sempre liberato dallo scarico di bozianu. impressionante la parata del numero 1 locale, che si distende e devia un tiro ravvicinato a mezza altezza. \nsul finire della prima frazione arriva il vantaggio veneto: basso sfrutta una palla persa per imbucare **marson** che la mette sotto la traversa.\nper reagire il manzano si appoggia a zenjili che lavora bene dal limite e si gira, trovando la gran parata di piede del subentrato **lukaj.**\n\n**secondo tempo** ‚Äì il manzano approccia la seconda frazione con un atteggiamento ancora pi√π combattivo. la bilancia delle occasioni pende a favore dei seggiolai. pericoloso **zenjili,** pericolosissimo **avitabile** che manda fuori di pochissimo da ottima posizione. ci mette del suo anche il portiere **lukaj** che esce sicuro su polimeni e piazza un miracolo su zenjili, servito in mezzo.\ni seggiolai devono stare attenti anche dietro: bravo fedrigo che in distensione blocca **bozianu.**\nal 10‚Äô il miti pregusta il colpaccio: fuga di **peruzzetto** sulla fascia che si invola in solitaria verso la porta e fa 2-0.\nil manzano non si perde d‚Äôanimo e lotta a testa bassa. a 10‚Äô dalla fine finalmente il meritato gol che dimezza lo svantaggio. **dalmasson** viene smarcato sulla sinistra e segna con un tiro che bacia il palo e va in gol: 1-2.\nsull‚Äôaltro fronte **da riol** ci mette il fisico vincendo un duello spalla a spalla, bravo **fedrigo** a chiuderlo in uscita. occasione anche per peruzzetto, out di poco.\nla partita √® testa, il manzano sfiora il pari pi√π volte, finch√© avitabile e zenjili portano avanti un‚Äôazione insistita, si apre un corriodio sulla sinistra per **polimeni** che viene servito e riesce a superare lukaj con un rasoterra deciso: 2-2 segnato dal giovane classe 2008.\nnel finale il manzano prova a vincerla ma deve accontentarsi del pari.\n\nprossimo turno di riposo per il manzano che torner√† in campo **sabato 6 dicembre** contro **l‚Äôunion diavoli c5.** si giocher√† sempre in casa, **a manzano,** alle **19.00,** dopo la partita della prima squadra.",
  "filename": "cuore-u21-miti-vicinalis-rimontato-da-2-0-a-2-2-20251124144153.html"
}
