  "content": "_Partita mai in discussione, ora i giovani seggiolai si preparano a 2 big match in casa_ Il Manzano Under 21 archivia la pratica Union Diavoli C5 senza particol",
  "fullText": "under 21 ancora convincente, 7-1 ai diavoli patrick lavaroni _partita mai in discussione, ora i giovani seggiolai si preparano a 2 big match in casa_\n\nil manzano under 21 archivia la pratica union diavoli c5 senza particolari problemi, regolando la compagine patavina con un netto 7-1. sul tabellino dei marcatori spiccano le doppiette di klejdi zharri, avitabile e zenjili. in generale buona prova di tutta la squadra che tiene in mano il match dall‚Äôinizio alla fine.\n\nprimo tempo ‚Äì manzano subito avanti grazie a klejdi zharri che acciuffa una palla persa sulla fascia e la mette sotto alle gambe del portiere. zraidi si mangia il raddoppio quando spara a lato una ribattuta con la porta spalancata. il manzano fa 2-0 comunque grazie a capitan avitabile e poi cala il tris a met√† della prima frazione. romanut ben imbucato viene chiuso dal portiere, la palla schizza sul lato dove zenjili trova la porta in ribattuta con un diagonale chirurgico.\nil poker arriva a 9‚Äô dalla sirena e porta la firma di bon, liberato da un lancio lungo. la quita rete nasce da romanut, bravo a difendere palla dal limite e a scaricarla alle spalle per l‚Äôaccorrente zenjili che la mette di potenza sotto l‚Äôincrocio.\n\nsecondo tempo ‚Äì la seconda frazione non cambia copione. la superiorit√† tecnica permette ai seggiolai di farla da padrone: grande imbucata di zraidi per avitabile che si invola in solitaria verso la porta, gran botta imparabile per il 6-0. arriva subito anche il 7¬∞ centro, secondo assist di zraidi che lavora bene sulla fascia e la mette in mezzo per klejdi zharri, gioco di gambe per mettere a sedere il portiere e 7-0.\nl‚Äôunion diavoli segna il gol della bandiera col tiro al volo di scantamburlo. per il resto la partita scorre via tra nervosismo (un‚Äôespulsione e un parapiglia nel finale causato dagli ospiti) e altre azioni del manzano, i pi√π pericolosi sono zenjili, polimeni e romanut.\nla squadra di piani si mantiene nel gruppo di testa, prossimo appuntamento sabato 13 dicembre per il big match in casa contro il sanve mille, che segue i manzanesi (quarti in classifica) a -1. fischio d‚Äôinizio alle 19.00 al palazzetto di manzano. il sabato seguente altra partita di cartello in casa contro il celtic verona, l‚Äôultima giornata del girone d‚Äôandata prima della sosta.",
