  "id": "aggressione-all-arbitro-sospesa-clark-manzano-20251213152419",
  "title": "Aggressione all‚Äôarbitro, sospesa Clark-Manzano",
  "meta": "Patrick Lavaroni ‚Äî Sabato 13 Dic 2025",
  "content": "_Grave episodio al termine del primo tempo, la nostra vicinanza al direttore di gara e all‚ÄôAIA_   La sfida tra Clark e Manzano si ferma al termine del primo tem",
  "fullText": "aggressione all‚Äôarbitro, sospesa clark-manzano patrick lavaroni _grave episodio al termine del primo tempo, la nostra vicinanza al direttore di gara e all‚Äôaia_\n \nla sfida tra clark e manzano si ferma al termine del primo tempo. gara sospesa per l‚Äôaggressione fisica ai danni del direttore di gara stefano tomasetig, ad opera di un tesserato della clark shimba olamba grance. il numero 7 della squadra locale era stato espulso nel finale della prima frazione a causa di un doppio giallo. il giocatore si rifiutava di abbandonare il campo causando circa 10 minuti di interruzione della partita. dopo il suono della sirena ha atteso la terna arbitrale all‚Äôesterno del rettangolo di gioco, riuscendo ad aggredire il primo arbitro con un violento pugno al volto per poi fuggire. immediata la decisione di sospendere la gara e la chiamata delle forze dell‚Äôordine.\n\nora la palla passa al giudice sportivo, nel mentre le partite previste per sabato 13 dicembre sono state rinviate a data da destinarsi.\n\nil c5 manzano 1988 esprime la massima vicinanza a stefano tomasetig per l‚Äôaggressione subita. l‚Äôarbitro √® parte del futsal. non √® un‚Äôentit√† esterna. come un giocatore vive momenti positivi e negativi, fronteggia critiche e delusioni, si allena e fa sacrifici per essere una componente di questo movimento. auguriamo a stefano una pronta guarigione, sperando che possa rientrare in campo in sicurezza per portare avanti la sua passione con entusiasmo e rispetto.\n\npassando al lato sportivo, il primo tempo era terminato 5-1 in favore del manzano. seggiolai subito in vantaggio con iurlaro servito da leonardo de giorgio. per il resto clark in avanti con il solito pozzatello a sfornare miracoli. i locali pareggiano con merito grazie alla botta di elezi. l‚Äô1-1 dura poco grazie al rientro di fusco che prima ristabilisce il vantaggio con una bordata e poi serve l‚Äôassist per il tris di klejdi zharri. 4-1 a firma di lorenzo de giorgio servito da tancos, abile in un recupero offensivo sul lancio di pozzatello. negli ultimi minuti l‚Äôespulsione di shimba e la conseguente 5¬∞ rete del manzano, firma di leonardo de giorgio, smarcato su rimessa laterale da tancos.\n\nquesta era l‚Äôultima partita di campionato del 2025. il calendario prevedeva semifinale e finale di coppa per la prossima settimana, ma i recenti fatti e la sospensione della gara pongono un grosso punto di domanda sulle date delle prossime partite.",
